import{_ as i,c as a,o as l,ab as e}from"./chunks/framework.CUflZczI.js";const d=JSON.parse('{"title":"Симуляція кількох рухомих засобів","description":"","frontmatter":{},"headers":[],"relativePath":"uk/simulation/multi-vehicle-simulation.md","filePath":"uk/simulation/multi-vehicle-simulation.md"}'),t={name:"uk/simulation/multi-vehicle-simulation.md"},s=e('<h1 id="симуляція-кількох-рухомих-засобів" tabindex="-1">Симуляція кількох рухомих засобів <a class="header-anchor" href="#симуляція-кількох-рухомих-засобів" aria-label="Permalink to &quot;Симуляція кількох рухомих засобів&quot;">​</a></h1><p>PX4 підтримує симуляцію кількох рухомих засобів використовуючи наступні симулятори:</p><ul><li><a href="./../sim_gazebo_gz/multi_vehicle_simulation.html">Симулятор Gazebo</a> (з та без ROS)</li><li><a href="./../sim_gazebo_classic/multi_vehicle_simulation.html">Симулятор Gazebo Classic</a> (з та без ROS)</li><li><a href="./../sim_flightgear/multi_vehicle.html">Симулятор FlightGear</a></li><li><a href="./../sim_jmavsim/multi_vehicle.html">Симулятор JMAVSim</a></li></ul><p>Вибір симулятора залежить від рухомого засобу що моделюється, наскільки &quot;якісна&quot; потрібна симуляція (і для яких функцій), і скільки засобів потрібно симулювати одночасно.</p><ul><li>FlightGear це найбільш точний симулятор і в результаті найбільш ресурсомісткий. Він може бути використаний, якщо вам потрібна гарна симуляція, але не надто багато засобів за раз. Також його можна використати, якщо потрібно симулювати різні типи рухомих засобів одночасно.</li><li><a href="./../sim_gazebo_gz/README.html">Gazebo</a> менш точний і менш потужний та підтримує багато функцій, які не доступні для FlightGear. Він може симулювати набагато більше засобів за раз, ніж FlightGear, та дозволяє симулювати різні їх типи водночас. Він може використовуватись тільки на Ubuntu 20.04 і новіше. Зверніть увагу, що це наступник <a href="./../sim_gazebo_classic/README.html">Gazebo Classic</a> (дивіться нижче).</li><li><a href="./../sim_gazebo_classic/README.html">Gazebo Classic</a> менш точний і менш потужний та підтримує багато функцій та засобів, які не доступні для FlightGear. Він може симулювати набагато більше засобів за раз, ніж FlightGear, та дозволяє симулювати різні їх типи водночас.</li><li>JMAVSim - це дуже легкий симулятор, який підтримує лише квадрокоптери. Рекомендується у випадку, якщо вам необхідно підтримувати багато квадрокоптерів та симуляція може бути приблизна.</li></ul>',5),o=[s];function m(_,h,c,r,u,n){return l(),a("div",null,o)}const g=i(t,[["render",m]]);export{d as __pageData,g as default};
